{% set group_id = None %}
{% for group in CTX.Groups %}
    {% if group.displayName == CTX.GroupName %}
            {{-group.id-}}
    {% endif %}
{% endfor %}

{% set required_params = {
    "state": "enabled",
    "snoozeDurationInDays": CTX.snoozeDays,
    "includeTargets": {
        "id": CTX.IncludeId.GroupId,
        "targetType": "group"
    },
    "excludeTargets": {
        "id": CTX.ExcludeId.GroupId,
        "targetType": "group"
    }
} %}
{% set Compliant = False %}
{% set all_Compliant = True %}
{% for param, expected_value in required_params.items() %}
    {% if CTX.RegistrationCampaign[param] != expected_value %}
        {% set all_Compliant = False %}
    {% endif %}
{% endfor %}
{% if all_Compliant %}
    {% set Compliant = True %}
{% endif %}
{{ Compliant }}
